import React from 'react';

function App() {
  return (
    <div>
      <Greeting name="FELIX BUTARBUTAR" />
      <Greeting name="" />
    </div>
  );
}

function Greeting(props) {
  return <p>Halo, {props.name}!</p>;
}

export default App;
